import React, { Component } from "react";
import Shoes from "./Shoes";

class Cloth extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <h3
          style={{
            textAlign: `center`,
            backgroundColor: `orangered`,
            color: `white`,
            padding: `20px`,
          }}
        >
          Fashion
        </h3>
        <div className="box">
          <Shoes shoes={this.state.cloth} />
        </div>
      </div>
    );
  }
}

export default Cloth;
